import React from 'react'
import Item from './Item/Item'
import classes from './Items.module.css'

const Items = (props) => {
  return (
    props.Data.map(item => {
      return (
        <Item
          Name={item.name}
          Description={item.description}
          Price={item.price}
          key={item.id}
          Source={item.source}
        />)
    })
  )
  return
}

export default Items
